            <a class="nav-link" href="#" onClick={app_id = "modstep", this.props.selectProductPage.bind(this,app_id)}>modstep</a>
        </li>
        <li class="nav-item">
            <a class="nav-link" href="#" onClick={app_id = "soda", this.props.selectProductPage.bind(this,app_id)}>soda</a>
        </li>
    </ul>
